import React from 'react';
class RealEstat extends React.Component {
 
    
      
    
    

  
    render() {
      return(
       < div className="contanir">
          <div class="img"> 
            <img src={this.props.item.image_url} alt="house"/>
            <div class="basic-info">
        <span style={{marginLeft: "3%"}}>{this.props.item.beds} BDS | {this.props.item.baths} ba | {this.props.item.sqft} sqr</span>
        <span style={{float: "right",marginRight: "3%"}}>{this.props.item.list_price}$</span>
      </div>
      
    </div>
       
       
      <style jsx>{`
      .contanir{
        margin-top: 5%;
        width: 100%;
        box-sizing: border-box;
        border-radius: 20px 20px 0 0;
        border: 1px solid #0259db94;
        overflow: hidden;
        font-size: 1.2vw;
      
      }
      .img img{
        max-width: 350px;
        min-width: 100px;
        max-height: 200px;
        margin: 0;
        box-sizing: border-box;
      }
      .img{
        max-height: 12vw;
        min-height: 12vw;
        overflow: hidden;
        position: relative;
      }
      .basic-info{
      font-size: 1.2vw;
      background-color:rgb(0, 0, 0,0.65)
      ;
      width: 100%;
      color: aliceblue;
      position: absolute;
      bottom: 0;
      left: 0;
      text-align: start;
      }
      .data-section{
        margin-top: 1.5%;
        font-size: 1vw;
        position: relative;
      
      }
      .compare{
        max-width: 85%;
        margin-right: auto;
      
      }
      .location,.comparison-section{
        margin-bottom: 1.5%;
        margin-right: 3%;
        margin-left: 3%;
      }
      .stars{
        position: absolute;
        right: 3%;
        color: #0257db;
      }
      .loc{
        margin-left: 2px;
      }
      .fontstyling{
      font-weight:bold
      ;}
      
      .footer{
        padding: 2%;
        color: #0257db;
        text-align: center;
        font-weight: bold;
        font-size: 1.2vw;
        border-bottom: 2px solid  #0259db94;
      
      }
    
      @media only screen and (max-width: 700px) {
       
       .data-section{
      margin-top: 0;
      margin-top: 0;
      font-size: 2vw;
        }
      .img{
        max-height: 100px;
        overflow: hidden;
        position: relative;
      }
      }
      @media only screen and (min-width: 2000px) {
      
      
        .data-section,.footer ,.basic-info,.contanir{
          font-size: 15px;
        }
      
        .img{
          max-height: 150px;
          min-height: 150px;
        }
      
        }
      
        @media only screen and (max-width: 400) {
          .img{
            max-height: 80px !important;
          }
        }
      
      `}</style>
       </div>
      )
           
    }
  }


  
  export default RealEstat;
